import PageHeader from '../PageHeader/PageHeader';
import classes from './Skills.module.css';

const backendSkills = 
    <ul>
        <li style={{textDecoration: 'underline'}}>BACKEND</li>
        <li>JAVA with SPRING BOOT (2 years experience: teaching and coding)</li>
        <li>PYTHON DJANGO (1 year experience)</li>
        <li>Firebase (1 year experience)</li>
    </ul>

const frontendSkills =
    <ul>
        <li style={{textDecoration: 'underline'}}>FRONTEND</li>
        <li>ReactJS - HTML - CSS - REDUX / NATIVE</li>
        <li>UI: Bootstrap and Materials to Build UIs: MUI</li>
    </ul>

const otherSkills = 
    <ul>
        <li style={{textDecoration: 'underline'}}>OTHER</li>
        <li>VERSION CONTROL:</li>
        <li>GitHub - VS Code</li>
        <li>Google Suite - Apple Suite</li>
    </ul>

const totalSkills = [backendSkills, frontendSkills, otherSkills]




const Skills = () => {
    return (  
    <div className={classes.Skills}>
        <PageHeader title = {"What about the Skillset?"} />
        <p>
            Get better by 1% per day! I take everyday to learn. 
            Below are some of the computing languages, toolkits, frameworks, 
            and libraries that I worked with and like:
        </p>
        <div className = {classes.Container}>
            {totalSkills.map(skills => {
                return (
                    <div className = {classes.List} >
                        {skills}
                        </div>
                )
            })}

        </div>
    </div> 
    );
}

export default Skills;
